    describe('loading in station history data', () => {
        describe('get_stations_on_date', () => {
            it('returns a complete list given a future date', () => {
                let stations = core.get_stations_on_date(moment("20200101", "YYYYMMDD"));
                expect(Object.keys(stations).length).to.be.above(608);  // 609 at time of writing.
            });
            it('returns an empty list given a long past date', () => {
                let stations = core.get_stations_on_date(moment("20000101", "YYYYMMDD"));
                expect(Object.keys(stations).length).to.equal(0);  // 609 at time of writing.
            });
            it('excludes stations that have closed by that date', () => {
                let stations = core.get_stations_on_date(moment());  // moment() means now, at runtime
                let station_ids = _.map(stations, s => +s.station_id);
                expect(station_ids).to.not.include(160);  // closed 2016-10-01 00:00:00
            });
            it('includes stations that have opened by that date', () => {
                let stations = core.get_stations_on_date(moment("20170101", "YYYYMMDD"));
                let station_ids = _.map(stations, s => +s.station_id);
                expect(station_ids).to.not.include(160);  // closed 2016-10-01 00:00:00
            });
        });
    });

